var Store = com.garagejs.common.Store;

function from_cache(url, data) {
    if (data)
        return null;

    cache_data = JSON.parse(Store.getFromLocal(url));
    if (!cache_data)
        return null;

    time = cache_data.time;
    expires_in = cache_data.expires_in;
    if (Date.now() - time > expires_in)
        return null;
    
    return cache_data.data;
}

function save_cache(url, data, retVal, expires_in) {
    if (data)
        return null;

    Store.storeIntoLocal(url, JSON.stringify({
        data: retVal,
        time:Date.now(), 
        expires_in: expires_in}));
}

//
function commonFunction_ajaxII(url, callback, data, expires_in){
    expires_in = typeof expires_in !== 'undefined' ? expires_in*1000 : 0;
    var cb_wrapper = function(retVal) {
        if (retVal && retVal.code == -13) { // 
            var path = location.pathname;
            var query_str = location.search;
            var hash = location.hash;
            location.href = '/wx/view/index?redirect=' + encodeURIComponent(path+query_str+hash);
            return;
        }
        else {
            if (expires_in && retVal && retVal.code == 0)
                save_cache(url, data, retVal, expires_in);
            return callback(retVal);
        }            
    };

    if (expires_in) {
        var retVal = from_cache(url, data);
        if (retVal)
            return callback(retVal);
    }


    var ajaxOptions = {
        formatJson: true,
        url: url,
        onSuccess: cb_wrapper,
        onError: callback,
    };
    if(data){
        ajaxOptions.type = "POST";
        ajaxOptions.data = JSON.stringify(data);
    }
    var ajax = new Ajax();
    ajax.send(ajaxOptions);
}

