function commonFunction_initSlider(id,retVal) {
    var id = '#'+id;
    var html = '<ul class="am-slides">';
    var banners = retVal.data;
    var number = banners.length;
    var pagenum = 0;
    var animationLoop = true;
    var touch =  true;
    if(number == 0)
        return;
    if(number == 1){
        animationLoop = false;
        touch = false;
    }
    for(var i = 0; i < banners.length; i++){
        html = html+'<li>' +
            '<img src="'+banners[i].image_path+'"/> ' +
            '</li>';
    }
    html = html+'</ul>';
    $(id).html(html);
    $(id).flexslider({
        controlNav:false,
        directionNav:false,
        keyboard:false,
        playAfterPaused:5000,
        slideshowSpeed:5000,
        animationLoop:animationLoop,
        touch: touch,
        before: function(slider) {
            if (slider._pausedTimer) {
                window.clearTimeout(slider._pausedTimer);
                slider._pausedTimer = null;
            }
        },
        after: function(slider) {
            var pauseTime = slider.vars.playAfterPaused;
            if (pauseTime && !isNaN(pauseTime) && !slider.playing) {
                if (!slider.manualPause && !slider.manualPlay && !slider.stopped) {
                    slider._pausedTimer = window.setTimeout(function () {
                        slider.play();
                    }, pauseTime);
                }
            }
            var index = slider.animatingTo;
            var content = banners[index].remarks;
            $("#grage-smalltitle1").text(content);
            $("#grage-smalltitle2").text(index+1);
        },
    });
    html = '<div class="garage-smalltitle"> ' +
        '<div class="garage-smalltitle-t1" id="grage-smalltitle1">'+banners[0].remarks+'</div> ' +
        '<div class="garage-smalltitle-t2" >'+'<span id="grage-smalltitle2">'+1+'</span>/'+number+'</div> ' +
        '</div> ';
    $(id).append(html);
}


Date.prototype.Format = function (fmt) { //author: meizz
    var o = {
        "M+": this.getMonth() + 1, //
        "d+": this.getDate(), //
        "h+": this.getHours(), //
        "m+": this.getMinutes(), //
        "s+": this.getSeconds(), //
        "q+": Math.floor((this.getMonth() + 3) / 3), //
        "S": this.getMilliseconds() //
    };
    if (/(y+)/.test(fmt)) fmt = fmt.replace(RegExp.$1, (this.getFullYear() + "").substr(4 - RegExp.$1.length));
    for (var k in o)
        if (new RegExp("(" + k + ")").test(fmt)) fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
    return fmt;
}

Vue.filter('dateFmt', function (value, pattern) {
    if (!value) return "";
    return new Date(value).Format(pattern || "yyyy-MM-dd");
});

Vue.filter('defaultValue', function (value) {
    if (!value) {
        return "--";
    }
    return value;
});

Vue.filter('timeFmt', function (timestamps) {
    if (timestamps <= 0) return "";
    var daysRound = Math.floor(timestamps / 1000 / 60 / 60 / 24);
    var hoursRound = Math.floor(timestamps / 1000 / 60 / 60 - (24 * daysRound));
    var minutesRound = Math.floor(timestamps / 1000 / 60 - (24 * 60 * daysRound) - (60 * hoursRound));
    var secondsRound = Math.floor(timestamps / 1000) - (24 * 60 * 60 * daysRound) - (60 * 60 * hoursRound) - (60 * minutesRound);
    var retVal = "";
    if (daysRound > 0)
        retVal += daysRound + "";
    if (hoursRound > 0)
        retVal += hoursRound + "";
    if (minutesRound > 0)
        retVal += minutesRound + "";
    if (secondsRound > 0)
        retVal += secondsRound + "";
    return retVal;
});

Vue.filter('formatDistance', function (val) {
    if (!val) {
        return "";
    } else if (val >= 1000) {
        return (val / 1000).toFixed(1) + "km";
    } else {
        return val + "m";
    }
});


Vue.filter('imageDefault',function(val){
    if (!val)
        return "/static/css/images/Loading.jpg";
    return val;
});

Vue.filter('brand_name',function(val){
    var minus = val.indexOf("-");
    if (minus > 0) {
        return val.substring(minus+2);
    }    

    return val;
});

Vue.filter('subbrand_name',function(val){
    var minus = val.indexOf("-");
    if (minus > 0) {
        return val.substring(0, minus);
    }

    return val;
});

